import "./portfolio.scss"

export default function Portfolio() {

    const list = [
        {
            id: "featured",
            title: "Featured",
        },
        {
            id: "web",
            title: "Web App",
        },
        {
            id: "mobile",
            title: "Mobile App",
        },
        {
            id: "data",
            title: "Data",
        },

    ];


    return (
        <div className = "portfolio" id="portfolio">
            <h1>Portfolio</h1>
            <ul>
                {list.map((item) => 
                (
                    <PortfolioList title={item.title}/>
                ))
                /* <li className="active">Featured</li>
                <li>Web App</li>
                <li>Mobile App</li>
                <li>Data Skills</li> */
                }
            </ul>
            <div className="container">
                <div className="item">
                    <a href="asset/shake.svg"></a>
                    <h3>Web App</h3>
                </div>
            </div>
        </div>
    )
}
